import React from "react";
import "./App.css";
import { Routes, Route, Link } from "react-router-dom";
import HomePage from "./containers/HomePage/HomePage";

function App() {
  return (
    <Routes>
      <Route index element={HomePage} />
      <Route
        path="*"
        element={
          <>
            <div>ERROR 404</div>
            <div>
              Back to Home Page <Link index />
            </div>
          </>
        }
      ></Route>
    </Routes>
  );
}

export default App;
